con:config.script:
def dataSet = context.getProperty("DataSet")
def dataSourceProperties = dataSet.getDataSet()

def currentRow = context.getProperty("Data_currentRow")?.toInteger() ?: 0

def rowCount = context.testCase.testSuite.getPropertyValue("Data_rowCount").toInteger()
context.setProperty("moreData","true")
log.info("currentRow: $currentRow")

def testCaseProperties = context.testCase.getProperties()
def properties = testCaseProperties.findAll { it.key.startsWith("DataColumn_$currentRow") }
properties.keySet().findAll { it.startsWith('DataColumn') }.each { testCase.removeProperty(it) }

log.info("Current row: $currentRow Row count: $rowCount")
if (currentRow < rowCount) {

    def propertyMap = dataSourceProperties.get(currentRow)
    propertyMap.each { key, value ->
        log.info("key: $key value: $value")
        context.testCase.setPropertyValue("DataColumn_${key}", value)
    }

    // Increment the row for the next iteration
    context.setProperty("Data_currentRow", (currentRow + 1).toString())

    // Use some logic to trigger the next iteration of the test case
} else {
    log.info("All rows have been processed.")
    // Optionally reset the currentRow for future runs
    context.setProperty("moreData","false")
}

