// For a TestSuite
def properties = testCase.getProperties()

def dataSource = new DataSource();

// Load the data as before
def lookupCityDataProperty = testCase.getPropertyValue("LookupCityData")

log.info("lookupCityDataProperty: ${lookupCityDataProperty}")

def workbook = lookupCityDataProperty.split("#")[0].trim()
def sheet = lookupCityDataProperty.split("#")[1].trim()
def hasHeaderRow = lookupCityDataProperty.split("#")[2].trim()
def startRow = Integer.parseInt(lookupCityDataProperty.split("#")[3].trim())
def startColumn = Integer.parseInt(lookupCityDataProperty.split("#")[4].trim())

log.info("Workbook: $workbook")
log.info("Sheet: $sheet")
log.info("Has header row: $hasHeaderRow")
log.info("Start Row: $startRow")
log.info("Star Column: $startColumn")

List<String> propertyNames = dataSource.getHeaderRow(workbook, sheet, 0)

List<Map<String, String>> dataSourceProperties = dataSource.setPropertiesFromExcel(
	   propertyNames, 
        workbook,
        sheet,
        startRow,
        startColumn
)

//context.setPropertyValue("DataSet", dataSourceProperties)
context.DataSet.dataSet = dataSourceProperties

// Store the number of rows to control the loop in the test case
testCase.setPropertyValue("Data_rowCount", dataSourceProperties.size().toString())
log.info("Data_rowCount: ${testCase.getPropertyValue("Data_rowCount")}")

con:config.script:
public class DataSet {
	public List<TreeMap<String, String>> dataSet

     // The three following fields are MANDATORY
     def log
     def context
     def testRunner

     // The constructor below is MANDATORY
     def DataSet(logIn, contextIn, testRunnerIn) {
        this.log = logIn
        this.context = contextIn
        this.testRunner = testRunnerIn
     }

     def List<Map<String, String>> getDataSet() {
        if(dataSet == null) {
        	dataSet = new LinkedList();
        }
        return dataSet
     }

}

context.setProperty( "DataSet", new DataSet(log, context, testRunner) )

public class Setup {
	     // The three following fields are MANDATORY
     def log
     def context
     def testRunner

     // The constructor below is MANDATORY
     def Setup(logIn, contextIn, testRunnerIn) {
        this.log = logIn
        this.context = contextIn
        this.testRunner = testRunnerIn
     }
}
context.setProperty( "Setup", new Setup(log, context, testRunner) )
